import React, { useContext } from "react";
import BookContext from "../store/book-context";

const Profile = () => {
  const bookCtx = useContext(BookContext);

  const logBooks = () => {
    console.log(bookCtx.books);
  };
  logBooks();
  return <div></div>;
};

export default Profile;
